import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import HomePage from './components/HomePage'
import UserPage from './components/UserPage'
import UserBody from './components/UserBody'


function App() {

  return (

    <Router>
      <Switch>

        <Route exact
          path="/"
          component={() => <HomePage />} />

        <Route
          exact
          path="/status/"
          component={() => <Body />}
        />

      <Route
          exact
          path="/profile/"
          component={() => <UserBody />}
        />

      </Switch>
    </Router>

  );
}

export default App;
